import React from 'react'
import { Link } from 'react-router-dom'

const Service = (props) => {
  return (
    <div className='service'>
      <Link>
        <div><img src={props.img} alt="" srcset="" /></div>
        <div><h3>{props.serv}</h3></div>
      </Link>
    </div>
  )
}

export default Service
